import React from 'react';

const HeroSection = () => {
  return (
    <div className="relative h-96 md:h-[500px] flex items-center justify-center text-center">
      <img
        src="https://picsum.photos/1200/500"
        alt="Hero Background"
        className="absolute inset-0 w-full h-full object-cover"
      />
      <div className="absolute inset-0 bg-black bg-opacity-50"></div>
      <div className="relative z-10 text-white">
        <h1 className="text-4xl md:text-6xl font-bold mb-4">Your Health, Our Priority</h1>
        <p className="text-lg md:text-xl mb-8">
          Get the best health insurance plans tailored to your needs.
        </p>
      </div>
    </div>
  );
};

export default HeroSection;
